console.log(data);let content="",templateStart='<div class="block">',templateEnd="</div>";for(let t=0;t<data.blocks.length;t++){let a=data.blocks[t];switch(a.type){case"header":content+=`${templateStart}<h${a.data.level}>${a.data.text}</h${a.data.level}>${templateEnd}`;break;case"paragraph":content+=`${templateStart}<p>${a.data.text}</p>${templateEnd}`;break;case"image":a.data.stretched?content+='<div class="block full">':content+=templateStart,content+=`<img src="${a.data.file.url}" alt="${a.data.caption}">`,data.blocks[t].data.caption&&(content+=`<div class="caption">- ${a.data.caption}</div>`),content+=templateEnd;break;case"embed":content+=`${templateStart}<iframe height="320" src="${a.data.embed}" frameborder="0" allowfullscreen></iframe>`,data.blocks[t].data.caption&&(content+=`<div class="caption">- ${a.data.caption}</div>`),content+=templateEnd}}document.getElementById("content").innerHTML=content;